import react from 'react'

// specjalizacje - we receive array of objects containing specialty's name and description
export default function DoctorsSpecialtyAside({data}) {
  console.log("data", data)
  let specjalizacje = data.specjalizacje

  console.log("specjal", specjalizacje)

  return (
    <>
      <div className='h-full w-36 bg-violet-600 shadow shadow-violet-800 flex flex-col'>
        {specjalizacje.map((specialty, i) => (
          <div className='w-full p-6 text-xl weight-semibold border-b border-white hover-violet-800' key={i} title={specialty.opis}>{specialty.nazwa}</div>
        ))}
      </div>
    </>
  )
}
